class App extends Component {
  render() {
    var courseDetails = [
      { name: "Complete React Course", price: 199 },
      { name: "Complete React Course", price: 200 },
      { name: "Complete React Course", price: 189 },
      { name: "Complete React Course", price: 190 },
    ];
    return <CoursePage courses={this.props.courseDetails} />;
  }
}
export default App;
